    return(
        <View style ={styles.logo}>
        <View>
            <Image 
                style= {styles.Image}
                source={require( '../assets/HealthWetu.png' )}
                />
        <Text> hello world </Text>
       </View>
 
/>
            
        
        </View>
    )
}
const styles = StyleSheet.create({
  
    logo:{
        justifyContent:'center',
        alignItems:'center',
        height:300,
        backgroundColor:'#a0abff'
    },
  });
